import React from 'react';

function MonCompte() {
  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4">Mon compte</h2>
      <p className="text-gray-700">
        Gérez ici vos informations personnelles et paramètres de compte.
      </p>
    </div>
  );
}

export default MonCompte;
